import "./BookInstance.css";

let somDict = {
  Name: [],
  Desc: [],
};

somDict.Name.push("Book 1 Name");
somDict.Desc.push("Book 1 Description");

function Book() {
  return (
    <>
      <div className="container-fluid">
        <div className="row">{<allBooks name/>}</div>
      </div>
    </>
  );
}

function allBooks(props) {
  for (let i = 0; i < props.name.length; i++) {
    return (
      <>
        <div className="col bookCol">
          <h1 className="display-3">{props.name[i]}</h1>
          <p>{props.desc[i]}</p>
        </div>
      </>
    );
  }
}

export default Book;
